const defaultState = {
   username: '',
   password: ''
}

const loginReducer = (state=defaultState, action) => {
   switch(action.type) {
      case "UPDATED_LOGIN":
         return {username: state.username, password: state.password}
      case "RESETTED_LOGIN":
         return {username: '', password: ''}
      default:
         return state
   }
}

export default loginReducer
